import React, { useState, useEffect } from "react";
import axios from "axios";
import "./index.css"; // Import your CSS file

const API_BASE = "http://localhost:3001";

function App() {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    getTodos();
  }, []);

